import React from 'react'
import logo from "../images/imarticus-new-logo.svg"
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import user from '../images/user.png'

const NavBar = () => {
    const navStyle = {


    }
    let userImageStyle = {
      borderRadius : "50%",
      border : "1px solid white",
      height :"40px",
      width  : "40px",

    }
  return (
    <div style = {navStyle}>
    <Navbar>
    <Container>
      <Navbar.Brand className = ''href="#home"><img src = {logo}/></Navbar.Brand>
      <Navbar.Toggle />
      <Navbar.Collapse className="justify-content-end">
        <Navbar.Text>
          <Button variant="outline-success">Get help</Button>{' '}
          <img style  = {userImageStyle} src = {user} />User
        </Navbar.Text>
      </Navbar.Collapse>
    </Container>
    </Navbar>
    </div>
  )
}

export default NavBar
